import Vue from 'vue';
import uuidv4 from "uuid/v4";
import CommonApiMixin from "@/components/Mixins/CommonApiMixin";

var css = require('css');

export default {
  name: "FooterComponent",
  mixins: [CommonApiMixin],
  created: function created() {
    this.setInit();
  },
  data: function data() {
    return {
      key: '',
      props: undefined,
      toggle: false,
      jsonData: undefined
    };
  },
  computed: {},
  methods: {
    setInit: function setInit() {
      var _this = this;

      Vue.component('FooterComp', function (resolve) {
        return _this.getAsync(resolve);
      });
    },
    setStyles: function setStyles(value) {
      value = value.replace(/<br>/gi, '\n');
      var el = document.getElementById("lp_style");

      if (el === null) {
        el = document.createElement("style");
        el.setAttribute("type", "text/css");
        el.setAttribute('id', 'lp_style');
        var head = document.getElementsByTagName('head')[0];
        head.appendChild(el);
      }

      if (el.innerText.indexOf(value) === -1) el.innerText += value;
    },
    getAsync: function getAsync(resolve) {
      var _this2 = this;

      var footer = this.$store.getters.device === 'mobile' ? 'FooterMobile' : 'FooterPc';
      this.request.common.get("https://launchpack-".concat(this.$store.getters.service.service_key, ".s3.ap-northeast-2.amazonaws.com/json_file/Footer/").concat(footer)).then(function (res) {
        var component = res.data;
        var props = component.props;
        Object.keys(props).forEach(function (key) {
          if (props[key].type && typeof props[key].type === "string") {
            props[key].type = eval("(".concat(props[key].type, ")"));
          }

          if (props[key].default && typeof props[key].default === "string" && props[key].default.indexOf('function()') > -1) {
            props[key].default = Function(props[key].default.replace('function()', ''));
          }
        });
        var _data = component.data;
        Object.keys(_data).forEach(function (key) {
          if (_data[key] === 'undefined') {
            _data[key] = undefined;
          }
        });

        var methods = _this2.getMethods(component.methods);

        var computed = _this2.getMethods(component.computed);

        var watches = _this2.getMethods(component.watch);

        var mixins = component.mixins;
        var lifeCycles = {};
        Object.keys(component.lifeCycles).forEach(function (item) {
          lifeCycles[item] = Function(component.lifeCycles[item].replace(/\$store/gi, '$store'));
        });
        var templates = component.templates.replace(/\$store/gi, '$store');
        var scopeId = "data-v-".concat(uuidv4().substring(0, 8));
        var styles = component.styles_scoped;

        if (styles) {
          var parsedCss = css.parse(styles);
          parsedCss.stylesheet.rules.forEach(function (rule) {
            if (rule.media) {
              rule.rules.forEach(function (inRule) {
                for (var i = 0; i < inRule.selectors.length; i++) {
                  var sels = '';
                  inRule.selectors[i].split(' ').forEach(function (sel) {
                    if (sel !== '&' && sel !== '>') {
                      sel += "[".concat(scopeId, "]");
                    }

                    sels += sel + ' ';
                  });
                  inRule.selectors[i] = sels;
                }
              });
            } else {
              for (var i = 0; i < rule.selectors.length; i++) {
                var sels = '';
                rule.selectors[i].split(' ').forEach(function (sel) {
                  if (sel !== '&' && sel !== '>') {
                    sel += "[".concat(scopeId, "]");
                  }

                  sels += sel + ' ';
                });
                rule.selectors[i] = sels;
              }
            }
          }); //this.$store.commit('setHeadStyles', css.stringify(parsedCss) + '\n');

          _this2.setStyles(css.stringify(parsedCss) + '\n');
        }

        var vueValues = {
          name: "".concat(footer),
          template: templates,
          props: props,
          data: function data() {
            return _data;
          },
          computed: computed,
          methods: methods,
          watch: watches,
          mixins: mixins,
          _scopeId: scopeId
        };
        Object.keys(lifeCycles).forEach(function (item) {
          vueValues[item] = lifeCycles[item];
        });
        resolve(vueValues);
        _this2.toggle = true;
      }).catch(function () {
        resolve({
          template: ''
        });
        _this2.toggle = false;
      });
    },
    getMethods: function getMethods(methods) {
      var result = {};
      methods.forEach(function (code) {
        code.name = code.name.replace(/'/g, ''); // code 내에 vuex 치환
        //this.$store.commit('setUser', val)

        code.code = code.code.replace(/\$store/gi, '$store');

        if (code.name.indexOf('/*') === 0 || code.name.indexOf('//') === 0) {
          var names = code.name.split('\n');
          code.name = names[names.length - 1].trim();
        }

        result[code.name] = code.params ? Function(code.params, code.code) : Function(code.code);
      });
      return result;
    }
  }
};
